import React, { Component } from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';


import Topbar from './components/Topbar/Topbar';
import Navbar from './components/Navbar/Navbar';
import Footer from './components/Footer/Footer';

import Index from './pages/Home/Index';
import Contact from './pages/Contact/Contact';
import Recruteur from './pages/Employeur/Employeur';
import Candidat  from './pages/Chauffeur/Chauffeur';
import AddChauffeur from './pages/Chauffeur/Postuler/AddChauffeur';
import ProfilChauffeur from './pages/Chauffeur/Profil/'

class App extends Component {
  render() {
    return (
      <div>
           <BrowserRouter>

              <Topbar />
              <Navbar />
                <Switch>
                <Route exact path='/' component={Index} />
                <Route exact path='/contact' component={Contact} />
                <Route exact path='/recruteur' component={Recruteur} />
                <Route exact path='/candidat' component={Candidat} />
                <Route exact path='/postuler' component={AddChauffeur} />
                </Switch>
              <Footer />
            </BrowserRouter>
      </div>
    );
  }

}

export default App;
